import {
  IconPdf,
  IconFileText,
  IconArrowMerge,
  IconArrowsSplit2,
  IconFileX,
  IconJpg,
  IconInfoCircle,
} from "@tabler/icons-react";
import { useNavigate } from "react-router-dom";

const mockdata = [
  {
    title: "Multiline input to PDF",
    icon: IconPdf,
    color: "violet",
    path: "/MultilineToPdf",
  },
  {
    title: "Text file to PDF",
    icon: IconFileText,
    color: "indigo",
  },
  { title: "Merge PDFs", icon: IconArrowMerge, color: "blue" },
  { title: "Split PDF", icon: IconArrowsSplit2, color: "green" },
  { title: "Rempve PDF Pages", icon: IconFileX, color: "teal" },
  { title: "PDF to JPG", icon: IconJpg, color: "cyan" },
  { title: "Coming Soon", icon: IconInfoCircle, color: "pink" },
  // { title: "Payments", icon: IconCoin, color: "red" },
  // { title: "Cashback", icon: IconCashBanknote, color: "orange" },
];

const useStyles = createStyles((theme) => ({
  card: {
    backgroundColor:
      theme.colorScheme === "dark"
        ? theme.colors.dark[6]
        : theme.colors.gray[0],
  },

  title: {
    fontFamily: `Greycliff CF, ${theme.fontFamily}`,
    fontWeight: 700,
  },

  item: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    textAlign: "center",
